var heIL={messages:{"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'":"'A Metamask error caused your wallet to disconnect. Reload the page to reconnect.'","A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.":"A signature is needed to trade this token on the Uniswap protocol. For security, signatures expire after 30 days.","Allow":"להתיר","Allow in your wallet":"אפשר בארנק שלך","Allow {symbol} first":["אפשר קודם ",["symbol"]],"Allowance pending":"קצבה בהמתנה","An error occurred when trying to execute this swap. You may need to increase your slippage tolerance. If that does not work, there may be an incompatibility with the token you are trading. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"אירעה שגיאה בניסיון לבצע החלפה זו. יתכן שתצטרך להגביר את סובלנות ההחלקה שלך. אם זה לא עובד, ייתכן שיש אי התאמה לאסימון שאתה סוחר בו. הערה: עמלה על אסימון העברה וריבוס אינם תואמים ל- Uniswap V3.","Approval pending":"מחכה לאישור","Approve":"לְאַשֵׁר","Approve Permit2":"Approve Permit2","Approve in your wallet":"אשר בארנק שלך","Approve {0} for trading":["Approve ",["0"]," for trading"],"Approve {symbol} first":["תחילה תאשר ",["symbol"]],"Auto":"אוטומטי","Auto Router":"נתב אוטומטי","Auto Router API":"Auto Router API","Balance:":"מאזן:","Best price route costs {0} in gas. Your price is optimized by considering split routes, multiple hops, and gas costs.":["Best price route costs ",["0"]," in gas. Your price is optimized by considering split routes, multiple hops, and gas costs."],"Cancel":"Cancel","Close":"סגור","Confirm in your wallet":"אשר בארנק שלך","Confirming approval":"Confirming approval","Connect to {0}":["Connect to ",["0"]],"Connect wallet":"חבר ארנק","Connecting…":"חיבור…","Continue":"Continue","Convert {0} to {1}":["המר ",["0"]," ל ",["1"]],"Convert {0} to {1} with no slippage":["Convert ",["0"]," to ",["1"]," with no slippage"],"Disconnect wallet":"נתק את הארנק","Dismiss":"לשחרר","Enter an amount":"הזן סכום","Error fetching trade":"שגיאה בשליפת המסחר","Exchange rate":"Exchange rate","Expected output":"Expected output","Fetching best price…":"משיג את המחיר הטוב ביותר…","Get support":"Get support","Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.":"Gives you the ability to trade this token on the Uniswap protocol. For security, this will expire in 30 days.","High slippage increases the risk of price movement":"החלקה גבוהה מגבירה את הסיכון לתנועת מחירים","I don't have a wallet":"אין לי ארנק","Insufficient liquidity":"Insufficient liquidity","Insufficient {0} balance":["איזון ",["0"]," לא מספיק"],"Invalid recipient":"נמען לא חוקי","Max":"מקסימום","Max slippage":"מקסימום החלקה","Maximum input after slippage":"Maximum input after slippage","Minimum output after slippage":"Minimum output after slippage","Missing dependencies":"חסרות תלות","Network fee":"עמלת רשת","No results found.":"לא נמצאו תוצאות.","No tokens are available on this network. Please switch to another network.":"אין אסימונים זמינים ברשת זו. נא לעבור לרשת אחרת.","Order routing":"Order routing","Output is estimated. You will receive at least {minReceivedString} or the transaction will revert.":["Output is estimated. You will receive at least ",["minReceivedString"]," or the transaction will revert."],"Output is estimated. You will send at most {maxSentString} or the transaction will revert.":["Output is estimated. You will send at most ",["maxSentString"]," or the transaction will revert."],"Permit2 allows safe sharing and management of token approvals across different smart contracts.":"Permit2 allows safe sharing and management of token approvals across different smart contracts.","Permit2 approval failed":"Permit2 approval failed","Please enter a valid slippage %":"אנא הזן % החלקה חוקית","Powered by the Uniswap protocol":"מופעל על ידי פרוטוקול Uniswap","Price impact":"השפעה על המחיר","Price updated":"המחיר עודכן","Reload":"Reload","Reload the page":"טען מחדש את הדף","Request rejected":"Request rejected","Review swap":"סקירת החלפה","Search by token name or address":"חפש לפי שם או כתובת אסימון","Select token":"Select token","Show less":"Show less","Show more":"Show more","Something went wrong":"משהו השתבש","Sorry, an error occured while processing your request. Please try again or contact support.":"Sorry, an error occured while processing your request. Please try again or contact support.","Success":"הַצלָחָה","Swap":"לְהַחלִיף","Swap failed: {0}":["החלפה נכשלה: ",["0"]],"Switch network":"החלף רשת","Switch network in your wallet":"החלף רשת בארנק","Switching network":"החלפת רשת","Test Title":"Test Title","The Uniswap invariant x*y=k was not satisfied by the swap. This usually means one of the tokens you are swapping incorporates custom behavior on transfer.":"המשתנה של Uniswap x * y = k לא הסתפק בהחלפה. זה בדרך כלל אומר שאחד מהאסימונים שאתה מחליף משלב התנהגות מותאמת אישית בהעברה.","The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.":"The amount you expect to receive at the current market price. You may receive less or more if the market price changes while your transaction is pending.","The estimated difference between the USD values of input and output amounts.":"The estimated difference between the USD values of input and output amounts.","The fee paid to miners to process your transaction. This must be paid in ETH.":"The fee paid to miners to process your transaction. This must be paid in ETH.","The impact your trade has on the market price of this pool.":"The impact your trade has on the market price of this pool.","The input token cannot be transferred. There may be an issue with the input token.":"לא ניתן להעביר את אסימון הקלט. יכול להיות שיש בעיה באסימון הקלט.","The network is confirming your Permit2 approval before you can swap.":"The network is confirming your Permit2 approval before you can swap.","The output token cannot be transferred. There may be an issue with the output token.":"לא ניתן להעביר את אסימון הפלט. ייתכן שיש בעיה באסימון הפלט.","The output token cannot be transferred. There may be an issue with the output token. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"לא ניתן להעביר את אסימון הפלט. ייתכן שיש בעיה באסימון הפלט. הערה: עמלה על אסימון העברה וריבוס אינם תואמים ל- Uniswap V3.","There will be a large difference between your input and output values due to current liquidity.":"There will be a large difference between your input and output values due to current liquidity.","This error was prompted by denying a request in your wallet.":"This error was prompted by denying a request in your wallet.","This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.":"This transaction could not be sent because the deadline has passed. Please check that your transaction deadline is not too low.","This transaction will not succeed due to price movement. Try increasing your slippage tolerance. Note: fee on transfer and rebase tokens are incompatible with Uniswap V3.":"עסקה זו לא תצליח בגלל תנועת מחירים. נסה להגביר את סובלנות ההחלקה שלך. הערה: עמלה על אסימון העברה ומיקום מחדש אינם תואמים ל- Uniswap V3.","This transaction will not succeed either due to price movement or fee on transfer. Try increasing your slippage tolerance.":"עסקה זו לא תצליח גם בגלל תנועת מחירים או עמלה על העברה. נסה להגביר את סובלנות ההחלקה שלך.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"מועד אחרון לעסקה","Transaction rejected":"העסקה נדחתה","Transaction submitted":"העסקה הוגשה","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"נסה להגדיל את סובלנות ההחלקה שלך.<0/>הערה: עמלה על העברה ואסימוני בסיס מחדש אינם תואמים ל-Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"שגיאה לא צפויה. לא ניתן היה לאמוד גז להחלפה.","Unexpected issue with estimating the gas. Please try again.":"בעיה בלתי צפויה בהערכת הגז. בבקשה נסה שוב.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"מבט על אתרסקאן","Wallet disconnected":"Wallet disconnected","Warning":"אַזהָרָה","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"העסקה שלך תחזור אם היא הייתה בהמתנה במשך יותר מתקופת זמן זו.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"העסקה שלך תחזור אם המחיר ישתנה בצורה לא טובה ביותר מאחוז זה.","minutes":"דקות","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{0} {1}":[["0"]," ",["1"]],"{0}. Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3.":[["0"],". Try increasing your slippage tolerance.\nNote: fee-on-transfer and rebase tokens are incompatible with Uniswap V3."],"{caption}":[["caption"]],"{integrator} fee":[["integrator"]," עמלה"],"{symbol} permit allowance failed: {0}":[["symbol"]," permit allowance failed: ",["0"]],"{symbol} token allowance failed: {0}":[["symbol"]," token allowance failed: ",["0"]],"{title}":[["title"]]}};

export { heIL as default };
